import sys
input = sys.stdin.readline

class UnionFind():
    def __init__(self, x):
        self.x = x
        self.parents = [-1] * (2 ** 32)

    def find(self, x):
        if self.parents[x] < 0:
            return x
        else:
            self.parents[x] = self.find(self.parents[x])
            return self.parents[x]

    def union(self, x, y):
        x = self.find(x)
        y = self.find(y)
        if x == y:
            return
        if self.parents[x] > self.parents[y]:
            x, y = y, x
        self.parents[x] += self.parents[y]
        self.parents[y] = x
        return

    def same(self, x, y):
        return self.parents[x] == self.parents[y]

    def members(self, x):
        return [i for i in range(self.parents.count(x)) if self.find(i) == x]

    def __str__(self):
        return '\n'.join('{}: {}'.format(i, self.parents[i]) for i in range(self.parents.count(x)) if self.find(i) == x)


