class Solution:
     def twoSum(self, nums, target):
         """
         :type nums: List[int]
         :type target: int
         :rtype: List[int]
         """
         if len(nums) == 0:
             return []

         n = len(nums)
         for i in range(n):
             if nums[i] + nums[i+1] == target:
                 return self.twoSum(nums, target - nums[i])
             elif nums[i] + nums[i+1] < target:
                 return self.twoSum(nums, target - nums[i])
             else:
                 return self.twoSum(nums, target - nums[i])

